import { useEffect, useState } from "react";
import useFetch from "../hooks/useFetch";
import { useLocation } from "react-router-dom";
import { Console } from "console";


const Meal = () => {
    const APIKEY = 'ae98638f897c4eb79d6f212f141affb8';
    const location = useLocation();
    const queryParams = new URLSearchParams(location.search);
    const id = queryParams.get('id');
    const {data, loading, error} = useFetch(`https://api.spoonacular.com/recipes/${id}/information?apiKey=${APIKEY}&includeNutrition=false`);
    const [mealRecipe, setMealRecipe] = useState<object[]>();

    useEffect(() => {
        if (data) {
        setMealRecipe(data);
        console.log(mealRecipe);
        console.log(data);
        }
    }, [data])


    return ( 
        <div className="foodRecipeContainer">

        </div>
     );
}
 
export default Meal;
